function groupByAlbum(tracks) {
    const albums = new Map();
    for (const track of tracks){
        const key = `${track.album}::${track.artist}`;
        if (!albums.has(key)) {
            albums.set(key, {
                artist: track.artist,
                albumArt: track.albumArt,
                tracks: []
            });
        }
        albums.get(key).tracks.push(track);
    }
    return albums;
}
